    //更新资产
    public void updateAssets() {
        //查询钱包
        List<Wellets> welletsList = welletsMapper.selectByCointype2(2);
        List<Users> users = usersMapper.selectAll();
        //读取需要导入的用户
        List<UserInputEntity> userInputEntities = readerUserXml();
        for (UserInputEntity userInputEntity : userInputEntities) {

            Optional<Users> first = users.stream().filter(q -> q.getPhonenum().equals(userInputEntity.getPhone())).findFirst();
            if (first.isPresent()) {
                Users users1 = first.get();
                Optional<Wellets> optional = welletsList.stream().filter(q -> q.getUserkey().equals(users1.getKeyes())).findAny();
                if (optional.isPresent()) {
                    Wellets wellets = optional.get();
                    if (userInputEntity.getAgcNumber().compareTo(BigDecimal.ZERO) > 0) {
                        wellets.setCoinnum(userInputEntity.getAgcNumber());
                        welletsMapper.updateByPrimaryKeySelective(wellets);
                        System.out.println(userInputEntity.getName() + "-" + "资产-" + userInputEntity.getAgcNumber().stripTrailingZeros().toPlainString());
                    }
                }
            }
        }
    }

