    @Transactional
    public void insertUser2(String nickname, String username) {
        String key = UUID.randomUUID().toString().replace("-", "");
        Users record = new Users();
        record.setKeyes(key);
        record.setUsername(username);
        record.setNickname(nickname);
        record.setPhonenum(username);
        record.setLoginpassword(MD5Util.getMD5String(key));
        record.setTranspassword(MD5Util.getMD5String("123456"));
        record.setCreatetime(new Date());
        usersMapper.insertSelective(record);

        Users user = usersMapper.selectByUserKey(record.getKeyes());
        user.setKeyes(user.getFid() + "");

        Optional<RealNameBean.DataBean.ListBean> optional = beanList.stream().filter(q -> q.getUserMobile().equals(user.getUsername())).findFirst();
        if (optional.isPresent()) {
            RealNameBean.DataBean.ListBean bean = optional.get();
            user.setPicture(bean.getIdCardHead());//头像
            user.setIsReal(2);//实名认证成功
            user.setIdentityId(bean.getIdCard());//身份证号
            user.setIdentityImg1(bean.getIdCardZmimg());
            user.setIdentityImg2(bean.getIdCardFmimg());
            user.setRealname(bean.getUserName());
        }
        usersMapper.updateByPrimaryKeySelective(user);

        addree_user address = new addree_user();
        String adress = EthUtilHuang.createEthAddress(MD5Util.getMD5String(MD5Util.getMD5String(MD5Util.getMD5String(ConfigConst.Turn_PWD + user.getFid()))));
        address.setUserkey(user.getKeyes());
        address.setAdress(adress);
        address.setKeyes(UUID.randomUUID().toString().replace("-", ""));
        address.setHelp("");
        addressDao.insertSelective(address);
        Wellets wellet;
        for (Coins coin : coinsList) {
            wellet = new Wellets();
            wellet.setAddress(address.getAdress());
            wellet.setUserkey(user.getKeyes());
            wellet.setCoinid(coin.getFid());
            wellet.setCointype(coin.getCoinshort());
            welletsMapper.insertSelective(wellet);
        }
        System.out.println(username + "-" + nickname + "-用户导入成功");
    }

    //读取用户
    private List<UserInputEntity> readerUserXml() {
        List<UserInputEntity> userInputEntities = new ArrayList<>();
        try {
            //读取表格数据
            InputStream in = this.getClass().getResourceAsStream("/用户列表.xlsx");
            XSSFWorkbook xssfWorkbook = new XSSFWorkbook(in);
            XSSFSheet xssfSheet = xssfWorkbook.getSheetAt(0);
            UserInputEntity userInputEntity;
            for (int i = 1; i <= xssfSheet.getLastRowNum(); i++) {
                userInputEntity = new UserInputEntity();
                XSSFRow xssfRow = xssfSheet.getRow(i);//获取每一行的数据
                //设置单元格类型
                XSSFCell cell = xssfRow.getCell(0);
                String stringCellValue0 = cell.getStringCellValue();
                userInputEntity.setName(stringCellValue0);

                XSSFCell cell1 = xssfRow.getCell(1);
                String stringCellValue = cell1.getStringCellValue();
                userInputEntity.setPhone(stringCellValue);

                XSSFCell cell2 = xssfRow.getCell(2);
                String stringCellValue1 = cell2.getStringCellValue();
                userInputEntity.setCreateTime(stringCellValue1);

                XSSFCell cell3 = xssfRow.getCell(3);
                double numericCellValue = cell3.getNumericCellValue();
                userInputEntity.setAgcNumber(new BigDecimal(numericCellValue + ""));


                XSSFCell cell4 = xssfRow.getCell(4);
                double numericCellValue1 = cell4.getNumericCellValue();
                userInputEntity.setTbNumber(new BigDecimal(numericCellValue1 + ""));
                userInputEntities.add(userInputEntity);
            }
            return userInputEntities;
        } catch (IOException e) {
            e.printStackTrace();
        }
        return userInputEntities;
    }
